import { useState } from "react";

export default function DividendCalculator() {
    const [initialInvestment, setInitialInvestment] = useState('');
    const [monthlyInvestment, setMonthlyInvestment] = useState('');
    const [dividendYield, setDividendYield] = useState('');
    const [dividendGrowthRate, setDividendGrowthRate] = useState('');
    const [inflationRate, setInflationRate] = useState('');
    const [years, setYears] = useState('');
    const [isTaxable, setIsTaxable] = useState(false);
    const [taxRate, setTaxRate] = useState('');
    const [result, setResult] = useState(null);

    const handleSubmit = async (event) => {
        event.preventDefault();

        const response = await fetch('http://localhost:8080/api/calculate', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                initialInvestment: parseFloat(initialInvestment),
                monthlyInvestment: parseFloat(monthlyInvestment),
                dividendYield: parseFloat(dividendYield),
                dividendGrowthRate: parseFloat(dividendGrowthRate),
                inflationRate: parseFloat(inflationRate),
                years: parseInt(years),
                taxable: isTaxable,
                taxRate: parseFloat(taxRate),
            }),
        });

        const data = await response.json();
        setResult(data);
    };

    return (
        <div>
            <h1>배당 재투자 계산기</h1>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>초기 투자금:</label>
                    <input type="number" value={initialInvestment} onChange={(e) => setInitialInvestment(e.target.value)} />
                </div>
                <div>
                    <label>월 적립식 투자금:</label>
                    <input type="number" value={monthlyInvestment} onChange={(e) => setMonthlyInvestment(e.target.value)} />
                </div>
                <div>
                    <label>시가 배당률 (%):</label>
                    <input type="number" value={dividendYield} onChange={(e) => setDividendYield(e.target.value)} />
                </div>
                <div>
                    <label>배당 성장률 (%):</label>
                    <input type="number" value={dividendGrowthRate} onChange={(e) => setDividendGrowthRate(e.target.value)} />
                </div>
                <div>
                    <label>물가상승률 (%):</label>
                    <input type="number" value={inflationRate} onChange={(e) => setInflationRate(e.target.value)} />
                </div>
                <div>
                    <label>투자 기간 (년):</label>
                    <input type="number" value={years} onChange={(e) => setYears(e.target.value)} />
                </div>
                <div>
                    <label>배당 과세 여부:</label>
                    <input type="checkbox" checked={isTaxable} onChange={(e) => setIsTaxable(e.target.checked)} />
                </div>
                {isTaxable && (
                    <div>
                        <label>세율 (%):</label>
                        <input type="number" value={taxRate} onChange={(e) => setTaxRate(e.target.value)} />
                    </div>
                )}
                <button type="submit">계산하기</button>
            </form>

            {result && (
                <div>
                    <h2>결과</h2>
                    <p>최종 투자금: {result}</p>
                </div>
            )}
        </div>
    );
};
